const {faker} = require('@faker-js/faker');
const MongoClient = require('mongodb').MongoClient;
const _ = require("lodash");
async function main(){
    const uri = "mongodb+srv://hayagreevan:hayagreevan@cluster0.sjx3gfu.mongodb.net/?retryWrites=true&w=majority"
    const client = new MongoClient(uri);

    try{
        await client.connect();

        const productsCollection = client.db('ecohub').collection('products');
        const categoriesCollection = client.db("ecohub").collection("categories");

        let categories = ['Laptops', 'Phones', 'HomeAppliances', 'Peripherals'].map((category) => { return { name: category } });
        await categoriesCollection.insertMany(categories);

        let imageUrls = [
            'data:image/jpeg;base64,',
            'https://images.unsplash.com/photo-1518770660439-4636190af475?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8Mnx8ZWxlY3Ryb25pY3N8ZW58MHx8MHx8fDA%3D&w=1000&q=80',
            'data:image/jpeg;base64,',
            'data:image/jpeg;base64,',
        ]

        let products = [];
        for (let i = 0; i < 10; i+=1) {
            let newProduct = {
                name: faker.commerce.productName(),
                adjective: faker.commerce.productAdjective(),
                desciption: faker.commerce.productDescription(),
                price: faker.commerce.price(),
                category: _.sample(categories),
                imageUrl: _.sample(imageUrls)
            };
            products.push(newProduct);
        }
        await productsCollection.insertMany(products); 
    } catch (e) {
        console.error(e);
    } finally {
        await client.close();
    }
}

main();